field_description:
The initial classification of data. This is subject to change after further review during the publishing process. It provides a broad pre-classification to help highlight potential constraints with publishing the data. In certain limited cases, it may be judged that there is no way to publish a dataset of value given the nature of data contained within. If that determination is made, it will be indicated in under the column "Publishing Status" with relevant status notes.

Classifications definitions are:

PUBLIC - this data could be publicly disseminated without any concerns; 

PROTECTED - this data is protected by law or regulation and can only be shared or accessed internally and per organizational procedures; OR this information includes individually identified information; 

SENSITIVE - in its raw form, this data poses security concerns, could be misused to target individuals or poses other concerns.

Departments were instructed during the inventory process to indicate a value of the dataset - Low, Medium or High. Department's were given guidance to help them make a simple assessment of each dataset. See the documentation attached to this dataset for more detail.

Definitions: 
Low - This data has unclear value for either the public or other city departments; we have never received requests for this data; or we have never heard a use case for this data;

Moderate - This data may be useful for other departments or for people external to the city; we occasionally receive requests for this information; or we have heard some examples for how this data could be used;

High - Existing and ongoing requests for this data; this data addresses pressing information needs or pain points (within or without the city); or we have heard compelling examples of how this data could be used;

D = demolition; 
U = upgrade leading to loss of units; 
M = merger; 
L = legalization of illegal unit ( + or -); 
CC = convert unit to commercial; 
AC = administrative correction; 
A = addition; 
CH = convert commercial to housing unit;
